import JsCookie from "js-cookie"

export default function StoreCookieBrowser( value ) {

    JsCookie.set( "RememberMe", value )

    const success = JsCookie.get( "RememberMe" ) !== undefined

    console.log(
        success ?
            "Cookie saved successfully to browser" :
            "Failed to save cookey to browser"
    )

    // Returns true if 'Remember Me' -cookie was added successfully
    return success
}
